export const incd_metadata = {dataset : "INCD", table_code : "INCDEPINEQEQ", years : "2002/03 - 2022/23", start_year : "2002/03", end_year : "2022/23", geog_level : "ni", dataset_url : "https://data.nisra.gov.uk/table/INCDEPINEQEQ", name : "Dissemination Branch", id : "EQGRP POVERTY", email : "info@nisra.gov.uk", subject : "Social Welfare", product : "Poverty", title : "Income Deprivation and Inequality", note : "[b]Income deprivation[/b]\r\n\r\n[b]How do we measure this?[/b]\r\nPercentage of people living in absolute poverty (before housing costs).\r\n\r\n[b]Income inequality[/b]\r\n\r\n[b]How do we measure this?[/b]\r\nPercentage of people living in relative poverty (before housing costs).\r\n\r\n[b]Source[/b]\r\nNorthern Ireland Poverty and Income Inequality Report, Department for Communities\r\n[url=https://www.communities-ni.gov.uk/topics/family-resources-survey]Family Resources Survey.[/url]\r\n\r\n[b]Section 75 category[/b]: Age\r\n[b]Variable used[/b]: Age\r\n[b]Breakdown available[/b]: 16-34; 35-49; 50-64; 65+\r\n\r\nAge is based on the age of the head of the benefit unit (family).\r\n\r\nAge bands 16-24 and 25-34 have been grouped together due to small sample sizes.\r\n\r\n[b]Section 75 category[/b]: Men and women generally\r\n[b]Variable used[/b]: Sex\r\n[b]Breakdown available[/b]: Male; Female\r\n\r\nChildren have been excluded, this data refers to adult males and adult females only.\r\n\r\n[b]Section 75 category[/b]: Marital status\r\n[b]Variable used[/b]: Marital status \r\n[b]Breakdown available[/b]: Single (never married or never in a legally registered civil partnership); Married or in a legally registered civil partnership; Separated or in a legally-recognised civil partnership and separated from civil partner; Divorced or formerly a civil partner, the civil partnership now legally dissolved; Widowed or surviving member of a legally registered civil partnership\r\n\r\nMarital status is based on the marital status of the head of the benefit unit. The subgroup co-habiting has been grouped with Married/Civil Partnership due to small sample sizes. Divorced and Separated have been grouped together due to small sample sizes.\r\n\r\n[b]Section 75 category[/b]: Persons with a disability and persons without\r\n[b]Variable used[/b]: Disability\r\n[b]Breakdown available[/b]: Disabled; Not Disabled\r\n\r\nDisability status is based on whether someone in the family has a disability / whether no-one in the family has a disability. \r\n\r\n‘Disability’ is measured using ‘limiting long-standing illness’. Respondents are defined as having a limiting long standing illness if they have any physical or mental health conditions or illnesses lasting or expected to last for 12 months or more, and the condition(s) or illness(es) reduce their ability to carry out day to day activities. The impairment types changed in 2012/13 therefore disability estimates are not directly comparable with those for years prior to 2012/13. Everyone classified as disabled under the FRS definition would also be classified as disabled under the Disability Discrimination Act (DDA). However, some individuals classified as disabled and having rights under the DDA would not be captured by this definition.\r\n\r\n[b]Section 75 category[/b]: Religious belief\r\n[b]Variable used[/b]: Religion\r\n[b]Breakdown available[/b]: Catholic; Protestant and other Christian religions\r\n\r\nReligion is based on the religion of the head of the benefit unit. Due to small sample sizes, reliable estimates are not available for the 'Other/None/Missing/Refused' category.\r\n\r\n[b]Section 75 category[/b]: Sexual orientation\r\n[b]Variable used[/b]: Sexual orientation\r\n[b]Breakdown available[/b]: Straight or heterosexual\r\n\r\nSexual orientation is based on the sexual orientation of the head of the benefit unit who is asked 'Which of the options on this card best describes how you think of yourself'? Options are: a. Heterosexual/ Straight, b. Gay/ Lesbian, c. Bisexual, d. Other.\r\n\r\nStraight or heterosexual is the only group with a large enough sample size. Due to small sample sizes, reliable estimates are not available for 'Gay/Lesbian', 'Bisexual' or 'Other'.\r\nData on Sexual Orientation is not available prior to 2011/12 as questions were not asked on the Family Resources Survey.\r\n\r\n[b]Section 75 category[/b]: Persons with dependants and persons without\r\n[b]Variable used[/b]: Dependants\r\n[b]Breakdown available[/b]: Has dependants (children only); Does not have dependants (children only)\r\n\r\nA 'Dependant' is an individual aged under 16. A person is also defined as a child if they are 16-19 years old and they are: not married; living with parents; and in full-time non-advanced education or in unwaged government training.\r\n\r\n[b]Section 75 category[/b]: Racial group\r\n[b]Breakdown available[/b]: Sample sizes are too small to provide reliable estimates for this breakdown\r\n\r\n[b]Section 75 category[/b]: Political opinion\r\n[b]Breakdown available[/b]: Unionist; Nationalist; Neither\r\n\r\nPolitical opinion is based on the political opinion of the head of the benefit unit, who is asked 'Generally speaking, do you regard yourself as a nationalist, a unionist or neither'? Data on Political opinion is not available prior to 2011/12 as questions were not asked on the Family Resources Survey."};
