export const lone_metadata = {dataset : "LONE", table_code : "LONEEQ", years : "2017/18 - 2022/23", start_year : "2017/18", end_year : "2022/23", geog_level : "ni", dataset_url : "https://data.nisra.gov.uk/table/LONEEQ", name : "PfG Analytics, The Executive Office", id : "EQGRP", email : "pfganalytics@executiveoffice-ni.gov.uk", subject : "Surveys", product : "Continuous Household Survey", title : "Loneliness", note : "[b]Loneliness\r\n\r\nHow do we measure this?[/b]\r\nPercentage of people aged 16+ who reported feeling lonely 'often/always' or 'some of the time'. For this indicator a lower figure is better.\r\n \r\n[b]Source[/b]\r\n[url=https://www.executiveoffice-ni.gov.uk/topics/statistics-and-research/individual-wellbeing-northern-ireland]Individual Wellbeing in Northern Ireland, The Executive Office[/url]\r\n \r\n[b]Further information[/b]\r\nThe coronavirus pandemic resulted in a change in data collection mode and a reduced sample size for 2020/21 and 2021/22. Therefore, users should take this into consideration when interpreting future years of data and care should be taken when comparing any findings published prior to 2020/21.\r\n\r\nData refers to the population aged 16 and over.\r\n\r\nData is collected through Continuous Household Survey (CHS). [url=https://www.nisra.gov.uk/statistics/central-survey-unit/continuous-household-survey]More information[/url].\r\n\r\nSome figures have been suppressed due to small sample sizes (less than 100 respondents),  missing values are denoted as ‘..’ or a blank space depending on the format it is being viewed.\r\n\r\n[b]Section 75 category:[/b] Age\r\n[b]Variable used:[/b] Age\r\n[b]Breakdown available:[/b] 16-24; 25-34; 35-49; 50-64; 65-75; 75+\r\n\r\n[b]Section 75 category:[/b] Men and women generally\r\n[b]Variable used:[/b] Sex\r\n[b]Breakdown available:[/b] Female; Male\r\n\r\n[b]Section 75 category:[/b] Marital status\r\n[b]Variable used:[/b] Marital status\r\n[b]Breakdown available:[/b] Single; Married/Civil partnership; Separated; Divorced; Widowed \r\n\r\n[b]Section 75 category:[/b] Persons with a disability and persons without\r\n[b]Variable used:[/b] Disability\r\n[b]Breakdown available:[/b] Disabled; Not Disabled\r\n\r\n[u]‘Disability’[/u] is measured using ‘limiting long-standing illness’. Respondents are defined as having a limiting long standing illness if they have any physical or mental health conditions or illnesses lasting or expected to last for 12 months or more, and the condition(s) or illness(es) reduce their ability to carry out day to day activities.\r\n\r\nDue to the changes to the survey mode and questionnaire as a result of the COVID-19 pandemic, disability was not included in the 2020/21 questionnaire.\r\n\r\n[b]Section 75 category:[/b] Religious belief\r\n[b]Variable used:[/b] Religion \r\n[b]Breakdown available:[/b] Catholic; Protestant and other Christian religions; Other/no religion\r\n\r\n[u]‘Other/no religion'[/u] includes those who stated a religion other than Catholic and Protestant, those who stated no religion, those who refused to answer the question, and those whose answer was missing.\r\n\r\n[b]Section 75 category:[/b] Sexual orientation\r\n[b]Breakdown available:[/b] These data are not collected by the survey\r\n\r\n[b]Section 75 category:[/b] Persons with dependants and persons without\r\n[b]Variable used:[/b] Dependants\r\n[b]Breakdown available:[/b] Has dependants; Does not have dependants\r\n\r\n[u]‘Has dependants’[/u] includes individuals who have responsibility for the care of: a child(ren); a person with a disability; and/or a dependant elderly person.\r\n\r\n[b]Section 75 category:[/b] Racial group\r\n[b]Variable used:[/b] Ethnic Group\r\n[b]Breakdown available:[/b] White; Other\r\n\r\n[u]‘Other'[/u] includes: 'Irish Traveller'; 'White and Black Caribbean'; 'White and Black African'; 'White and Asian'; 'Any other mixed/multiple ethnic background'; 'Indian'; 'Pakistani'; 'Bangladeshi'; 'Chinese'; 'Any other Asian background'; 'African'; 'Caribbean'; 'Any other Black/African/Caribbean background'; 'Arab'; and 'Any other ethnic group'.\r\n\r\n[b]Section 75 category:[/b] Political opinion\r\n[b]Breakdown available:[/b] These data are not collected by the survey"};
