export const prej_metadata = {dataset : "PREJ", table_code : "PREJUDEQ", years : "2019 - 2022", start_year : "2019", end_year : "2022", geog_level : "ni", dataset_url : "https://data.nisra.gov.uk/table/PREJUDEQ", name : "PfG Analytics, The Executive Office", id : "EQGRP", email : "pfganalytics@executiveoffice-ni.gov.uk", subject : "Surveys", product : "Life and Times Survey", title : "Self-reported prejudice against minority ethnic communities", note : "[b]Self-reported prejudice against minority ethnic communities[/b]\r\n\r\n[b]How do we measure this?[/b]\r\nPercentage aged 18+ who self-report being prejudiced against people from minority ethnic communities.\r\n\r\n[b]Source[/b]\r\n[url=https://www.executiveoffice-ni.gov.uk/topics/statistics-and-research/racial-equality]Racial Equality | The Executive Office.[/url]\r\n\r\n[b]Further information[/b]\r\nThe source for this indicator is the Northern Ireland Life and Times Survey (NILT) which is an attitudinal survey that takes place at a particular point in the year. One-off events of a particular local or national level occurring during, or close to the survey's fieldwork period may impact results and create volatility from year to year.\r\n\r\nTo account for sampling error, the data have been weighted by age, gender, and location, based on the most recently available Census data.\r\n\r\nIn 2020, the NILT survey was moved from an in-person interviewer-led survey to a combination of CAWI (Computer Assisted Web Interviewing) and CATI (Computer Assisted Telephone Interviewing) - the new format has been used in every year since 2020.\r\n\r\nRespondents to this survey were asked: 'Would you describe yourself as very prejudiced against people of minority ethnic communities, a little prejudiced, or not prejudiced at all?' The figures reported are the proportions who selected 'very prejudiced' or 'a little prejudiced'.\r\n\r\nSome figures have been suppressed due to small sample sizes (less than 50 respondents), missing values are denoted as ‘..’ or a blank space depending on the format it is being viewed.\r\n\r\n[b]Section 75 category[/b]: Age\r\n[b]Variable used[/b]: Age\r\n[b]Breakdown available[/b]: 18-24; 25-44; 45-64; 65-74; 75+\r\n\r\n[b]Section 75 category[/b]: Men and Women generally\r\n[b]Variable used[/b]: Sex\r\n[b]Breakdown available[/b]: Male; Female\r\n\r\n[b]Section 75 category[/b]: Marital status\r\n[b]Variable used[/b]: Marital status \r\n[b]Breakdown available[/b]: Single (never married or never legally registered a civil partnership); Married or in a legally registered civil partnership; Other marital or civil partnership status\r\n\r\n[u]Other marital or civil partnership status includes[/u]: Married and separated from husband/wife; Divorced; Widowed; In a legally-recognised civil partnership and separated from civil partner; Formerly a civil partner, the civil partnership now legally dissolved; A surviving civil partner as partner has died.\r\n\r\n[b]Section 75 category[/b]: Disability\r\n[b]Variable used[/b]: Disability\r\n[b]Breakdown available[/b]: Disabled; Not Disabled\r\n\r\n‘Disability’ is measured using ‘limiting long-standing illness’. Respondents are defined as having a limiting long standing illness if they have any physical or mental health conditions or illnesses lasting or expected to last for 12 months or more, and the condition(s) or illness(es) reduce their ability to carry out day to day activities.\r\n\r\n[b]Section 75 category[/b]: Religious belief\r\n[b]Variable used[/b]: Religion\r\n[b]Breakdown available[/b]: Catholic; Protestant and other Christian religions; Other religions; No religion; Religion not stated\r\n\r\n[u]Protestant and other Christian religions includes[/u]: Church of Ireland/Anglican/Episcopal; Baptist; Methodist; Presbyterian; Free Presbyterian; Brethren; United Reform Church (URC)/Congregational; Pentecostal; Church of Scotland; Elim Pentecostal; Reformed Presbyterian; Non-subscribing Presbyterian; Salvation Army; Church of Nazarene; Jehovah's Witness; Church of Jesus Christ of Latter Day Saints (Mormon); Other Protestant; Other Christian.\r\n\r\n[u]Other religions includes:[/u] Hindu; Jewish; Islam/Muslim; Sikh; Buddhist, Other.\r\n\r\n[b]Section 75 category[/b]: Sexual orientation\r\n[b]Variable used[/b]: Sexual orientation\r\n[b]Breakdown available[/b]: Straight or heterosexual; Gay, lesbian, bisexual or other sexual orientation \r\n\r\n[b]Section 75 category[/b]: Dependants\r\n[b]Breakdown available[/b]: These data are not collected by the survey\r\n\r\n[b]Section 75 category[/b]: Racial group\r\n[b]Variable used[/b]: (The Executive Office) Racial Equality\r\n[b]Breakdown available[/b]: Category 1; Category 2; Category 3\r\nCategory 1: Individuals with ethnic group white, a British, Irish or Northern Irish national identity only; and who reported their religion as Christian, no religion, or did not state a religion.\r\nCategory 2: Individuals with ethnic group white, who did not have a British, Irish or Northern Irish national identity, or who reported a non-Christian religion.\r\nCategory 3: Everyone who reported a non-white ethnic group (includes Chinese, Irish Traveller, Indian, Pakistani, Bangladeshi, Other Asian, Black Caribbean, Black African, Black Other, Mixed ethnic group, Other ethnic group).\r\n\r\n[b]Section 75 category[/b]: Political opinion\r\n[b]Breakdown available[/b]: These data are not collected by the survey"};
